CREATE TABLE m_skill_effect(
  id INTEGER NOT NULL,
  target_parameter INTEGER NOT NULL,
  effect_type INTEGER NOT NULL,
  effect_value INTEGER NOT NULL,
  scale_type INTEGER NOT NULL,
  calc_type INTEGER NOT NULL,
  timing INTEGER NOT NULL,
  icon_asset_path TEXT,
  finish_type INTEGER NOT NULL,
  finish_value INTEGER NOT NULL,
  PRIMARY KEY (id)
);
